// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Default from './Pages/Default';
import Login from './Pages/Login';
import Home from './Pages/Home';
import MediaUpload from './Pages/MediaUpload';
import UserProfile from './Pages/UserProfile';
import Navbar from './routes/Navbar';
import Register from './Pages/Register';
import { useAuth } from './hooks/useAuth';

const App = () => {
  console.log('Rendering App component.');

  const { isAuthenticated } = useAuth();

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Default />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Use Navigate directly within JSX for routes that require authentication */}
        <Route path="/Home" element={isAuthenticated ? <><Navbar /><Home /></> : <Navigate to="/login" replace />} />
        <Route path="/MediaUpload" element={isAuthenticated ? <><Navbar /><MediaUpload /></> : <Navigate to="/login" replace />} />
        <Route path="/UserProfile" element={isAuthenticated ? <><Navbar /><UserProfile /></> : <Navigate to="/login" replace />} />
      </Routes>
    </Router>
  );
};

export default App;
